const HOME = 'HOME';

const initialState = {
  socImages: [
    { facebook: '' },
    { iconSrc: 'https://www.instagram.com/static/images/ico/favicon-200.png/ab6eff595bb1.png', icalt: 'instagram' },
    { iconSrc: 'https://upload.wikimedia.org/wikipedia/commons/thumb/9/91/Octicons-mark-github.svg/1200px-Octicons-mark-github.svg.png', icalt: 'github' },
    { iconSrc: '', icalt: 'gmail' },
    { icalt: 'youtube' },

  ]
}

export default function HomeReducer(state = initialState, action) {

  switch (action.type) {
    default:

      return state;
  }
}
